import React from "react";
import ListItem from "./comp_list/comp_listItem/listItem_comp";

const List = ({todos}) =>{
    return(
        <ul>
            {
                todos.map(todo => <ListItem todo={todo} key={todo.id}/>)
            }
        </ul>
    )
}

export default  List;
